      "cell_type": "code",
      "source": [
        "\n",
        "import os\n",
        "import numpy as np\n",
        "from tensorflow.keras.preprocessing.image import load_img, img_to_array\n",
        "import shutil\n",
        "from google.colab import files\n",
        "\n",
        "# 1️⃣ Settings\n",
        "IMG_SIZE = (128, 128)\n",
        "DATASET_PATH = \"/content/BIQ2021\"  # folder with original images\n",
        "OUTPUT_FOLDER = \"/content/preprocessed_dataset\"  # folder to save .npy files\n",
        "os.makedirs(OUTPUT_FOLDER, exist_ok=True)\n",
        "\n",
        "# 2️⃣ Preprocess images in batches\n",
        "BATCH_SIZE = 500\n",
        "image_files = [f for f in os.listdir(DATASET_PATH) if f.lower().endswith(('.jpg', '.jpeg', '.png'))]\n",
        "\n",
        "batch_num = 0\n",
        "for i in range(0, len(image_files), BATCH_SIZE):\n",
        "    batch_files = image_files[i:i+BATCH_SIZE]\n",
        "    batch_data = []\n",
        "    for img_file in batch_files:\n",
        "        img_path = os.path.join(DATASET_PATH, img_file)\n",
        "        try:\n",
        "            img = load_img(img_path, target_size=IMG_SIZE)\n",
        "            img_array = img_to_array(img) / 255.0\n",
        "            batch_data.append(img_array)\n",
        "        except Exception as e:\n",
        "            print(f\"Skipping {img_file}: {e}\")\n",
        "    batch_data = np.array(batch_data)\n",
        "    batch_filename = os.path.join(OUTPUT_FOLDER, f'preprocessed_batch_{batch_num}.npy')\n",
        "    np.save(batch_filename, batch_data)\n",
        "    print(f\"Saved {batch_filename} with shape {batch_data.shape}\")\n",
        "    batch_num += 1\n",
        "\n",
        "# 3️⃣ Zip the folder\n",
        "shutil.make_archive('preprocessed_dataset', 'zip', OUTPUT_FOLDER)\n",
        "print(\"ZIP file created: preprocessed_dataset.zip\")\n",
        "\n",
        "# 4️⃣ Download the ZIP\n",
        "files.download('preprocessed_dataset.zip')\n",
        "\n",
        "\n"
